import './App.css';
import React from "react";
import ChooseRole from './components/ChooseRole';
import { Provider } from 'react-redux'
import Store from './store/Store';
class App extends React.Component() {
  render(){
    return(
      <Provider store={Store}>
        <ChooseRole/>
      </Provider>
    )
  }
}

export default App;
